import img_01 from './../img/projects/01.jpg';
import img_02 from './../img/projects/02.jpg';
import img_03 from './../img/projects/03.jpg';
import img_04 from './../img/projects/04.jpg';
import img_05 from './../img/projects/05.jpg';
import img_06 from './../img/projects/06.jpg';

const ProjectItem = () => {
    return (
        <li className="project">
            <a href="./project-page.html">
                <img src={img_01} alt="Project img" className="project__img" />
                <h3 className="project__title">Gaming streaming portal</h3>
            </a>
        </li>
    );
}
 
export default ProjectItem;
